import React from "react";

export default function Modal(props) {
  return (
    <div>
      <div className="img"></div>
      <h3 className="name">{props.name}</h3>
      <div className="type"></div>
      <div className="height"></div>
      <div className="weight"></div>
    </div>
  );
}
